import React from "react";
import "bootstrap/dist/css/bootstrap.min.css";
import { Link } from "react-router-dom";
import ProfileImage from "./ProfileImage";
import SideBar from "./SideBar";
export default function HomePageMenu() {
  return (
    <div className="row">
      <div className="col offset-1">
        <h1 style={{ color: "white" }}>Omer Perez</h1>
        <h4 style={{ color: "#cccccc" }}>Junior Full Stack Developer</h4>
        <br />
        <div style={{ textAlign: "left" }}>
          <b style={{ fontSize: "200%", color: "#4682B4" }}>M</b>ore than 4
          years of managing technological teams that provide infrastructure and
          support to software teams field as part of my service as a captain
          (officer) in both MAMRAM and 8200 units in the IDF.
          <br />
          <b style={{ fontSize: "200%", color: "#4682B4" }}>3</b>rd year B.Sc.
          in Computer Science in The College of Management Academic Studies,
          seeks real-world experience as Full Stack. Offers strong interpersonal
          and task prioritization skills.
          <br />
          <b style={{ fontSize: "200%", color: "#4682B4" }}>G</b>ood high
          leading skills, with assertive personality, a team player, problems
          solver, Can Do attitude, and excellent self-learning skills.
        </div>
      </div>
      <div className="col-md-2 offset-md-1">
        <img
          className="mt-5"
          style={{
            width: "430px",
            height: "300px",
            boxShadow:
              "0 10px 20px 0 rgba(0, 0, 0, 0.2), 0 6px 20px 0 rgba(0, 0, 0, 0.19)",
          }}
          src="../Images/CoverImage.jpg"
        />
      </div>
    </div>
  );
}
